import React from "react";

function VisualizationDashboard() {
  return (
    <div className="min-h-screen bg-white">
      <header className="bg-gradient-to-r from-blue-600 to-teal-400 text-white py-8 px-8 shadow-md">
        <div className="container mx-auto flex items-center justify-start space-x-6">
          <img src="/logo2.png" alt="Dashboard Logo" className="w-32 h-auto" />
          <h1 className="text-4xl md:text-5xl font-extrabold tracking-tight">Visualization Dashboard</h1>
        </div>
      </header>

      <main className="container mx-auto py-16 px-4">
        <h2 className="text-3xl font-bold text-gray-800 mb-8">Your Data Overview</h2>

        {/* Sample Chart Section */}
        <div className="grid grid-cols-1 md:grid-cols-2 gap-10">
          {/* Example of a bar chart visualization */}
          <div className="bg-gray-100 p-8 rounded-lg shadow-lg">
            <h3 className="text-xl font-semibold mb-4">Chart Title 1</h3>
            <img src="/images/sample_chart1.png" alt="Sample Chart 1" className="w-full h-64 object-cover"/>
          </div>

          {/* Example of a pie chart visualization */}
          <div className="bg-gray-100 p-8 rounded-lg shadow-lg">
            <h3 className="text-xl font-semibold mb-4">Chart Title 2</h3>
            <img src="/images/sample_chart2.png" alt="Sample Chart 2" className="w-full h-64 object-cover"/>
          </div>
        </div>
      </main>
    </div>
  );
}

export default VisualizationDashboard;
